import React from 'react';
import { Grid, Typography } from '@mui/material';
import "./styles.css";

const HomePage = ()  => {
  return (
    <Grid container sx={{ p: 2, border: 1}}>
      <Grid item xs={12}>
        <Typography variant="h2">
          Welcome to Jot
        </Typography>
        <Typography variant="subtitle1">
          Pick your canvas
        </Typography>
      </Grid>
    </Grid>
  );
};

export default HomePage;
